import React from 'react';

function UploadHistory() {
    return (
        <div>
            <h1 className="text-2xl font-bold mb-4">업로드 내역</h1>
            <p>이곳에서 X-Ray 이미지 업로드 내역을 확인할 수 있습니다.</p>
            {/* 여기에 업로드 내역 목록이 표시됩니다. */}
        </div>
    );
}

export default UploadHistory;
